	add("kath", "{\"term\":\"kath\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A diminutive of the female given names Katherine, Kathleen, and related names\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027 Margaret Atwood: \u0027Wilderness Tips\u0027 ISBN 0385 421060 : page 36\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"During her childhood she was a romanticized Katherine, dressed by her misty-eyed, fussy mother in dresses that looked like ruffled pillowcases. By high school she\u0027d shed the frills and emerged as a bouncy, round-faced Kathy - - - At university she was \u0027\u0027Kath\u0027\u0027, blunt and no-bullshit in her Take-Back-the-Night jeans and checked shirt - - - When she ran away to England, she sliced herself down to Kat. It was economical, street-feline, and pointed as a nail\", \"priority\":3}]}, \"synonyms\":{}}");

